            setBackendData(data);
        })
    }, [])

    return (
        <div>
            {(typeof backendData.city === 'undefined') ?
                (
                <p>Loading...</p>
                ) :
                (
                    backendData.map((x, index) => (
                        <p key={index}>

                        </p>
                    ))
            )}
        </div>
    );
};

export default App;
